// Settings 


// Loader 

NProgress.configure({
    template: '<div class="bar" role="bar"></div>',
    parent: '#header-loader',
    showSpinner: false,
    easing: 'ease',
    minimum: 0.3,
    speed: 500,
});

NProgress.start();



// ImagesLoaded for preloader 

$('.swiper-container').imagesLoaded( { background: true }, function() {
  setTimeout(function() {
    $('body').addClass('loaded');
    $('.homepage-load, .offpage__content').addClass('fade-in');
    $('#header-loader-under-bar').addClass('fade-out');

    NProgress.done();
  }, 1000);
});



// onepage app 


// Open off-page 

$(function(){
  $('.open').click(function(){

    if($('body').hasClass('offpage-active')) {
        $('body').noop;
      } else {
          $('body').toggleClass('offpage-active');
        }

	  $('.close').fadeIn(300);
	  $('.page-box').css('display', 'block');
	  $('.offpage__content').animate({scrollTop: '0'}, 0);  
	  $('body').animate({scrollTop: '0'}, 0);

	  NProgress.start();
	  $(document).ajaxSuccess( function() {
	    setTimeout(function() {
	      $('#header-loader-under-bar').addClass('fade-out');
	      NProgress.done();
	    }, 500);          
	  });

  });
});



// Sliders


// v1 (hero-100vh)

$(function(){
  var mySwiper = new Swiper ('.hero-100vh.v1', {
  // Optional parameters
  direction: 'horizontal',
  loop: true,
  grabCursor: true,
  preventClicks: true,
  preventClicksPropagation: true,
  autoplay: 3000,
  speed: 600,
  parallax: true,
  effect: 'slide',

  // If we need pagination
  pagination: '.swiper-pagination',
  paginationClickable: true,
  
  // Navigation arrows
  nextButton: '.swiper-button-next',
  prevButton: '.swiper-button-prev',

  // Breakpoints
  breakpoints: {
      1200: {
        parallax: false
      }
    }
  });
});


